import { Logo } from "components/atom/Logo";
import Music from "components/atom/Music/Music";
import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";

import "./Header.scss";

export type HeaderProps = {
  cx?: string;
};

export const Header: React.FC<HeaderProps> = ({ cx = "" }) => {
  const navigate = useNavigate();
  const [select, setSelect] = useState(0);
  const [isOpen, setIsOpen] = useState(false);

  const handleClickBg = (e: any) => {
    if (!e.target.className.toString().includes("element")) {
      setIsOpen(_=>!_);
      window.removeEventListener("click", handleClickBg);
    }
  };

  useEffect(() => {
    if (isOpen) {
      window.addEventListener("click", handleClickBg);
    }
    // eslint-disable-next-line
  }, [isOpen]);

  return (
    <>
      <aside className={`Header ${cx} Desktop`}>
        <Logo
          cx={"HeaderLogo"}
          onClick={() => {
            setSelect(0);
            navigate("/");
          }}
        />

        <div className="menu">
          <Link to={"/notice"} onClick={() => setSelect(1)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
          <Link to={"/world"} onClick={() => setSelect(2)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
          <Link to={"/system"} onClick={() => setSelect(3)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
          <Link to={"/qna"} onClick={() => setSelect(4)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
          <Link to={"/member"} onClick={() => setSelect(5)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
        </div>
        <Music/>
        <div className="line">
          <div className={`cursor _${select}`}>
            <img


              src={
                "data:img/png;base64,"
              }
              alt={""}
              className={` _${select}`}
            />
          </div>
          <img
            src="data:img/png;base64,"
            alt=""
          />
        </div>
      </aside>
      <aside className={`MobileHeader ${cx} ${isOpen} element`}>
        <Logo
          cx={"HeaderLogo"}
          onClick={() => {
            if (isOpen) {
              navigate("/");
            }
            setSelect(0);
            setIsOpen((_) => !_);
          }}
        />
        <div className={`ani ${isOpen}`}>
          <span>&gt;</span>
          <span>&gt;</span>
        </div>

        <div className="menu-top">
          <Link to={"/notice"} onClick={() => setSelect(1)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
          <Link to={"/world"} onClick={() => setSelect(2)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
          <Link to={"/system"} onClick={() => setSelect(3)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
        </div>
        <div className="menu-bottom">
          <Link to={"/qna"} onClick={() => setSelect(4)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
          <Link to={"/member"} onClick={() => setSelect(5)}>
            <img
              src="data:img/png;base64,"
              alt=""
              className="back-line"
            />
            <img
              src="data:img/png;base64,"
              alt=""
            />
          </Link>
        </div>
        <div className="line">
          <div className={`cursor _${select}`}>
            <img
                onClick={() => {
                  if(!isOpen){
                    setIsOpen(true);
                  }
                }}
              src={
                "data:img/png;base64,"
              }
              alt={""}
              className={` _${select}`}
            />
          </div>
          <img
            className={"bg"}
            src={
              "data:img/png;base64,"
            }
            alt=""
          />
        </div>
      </aside>
    </>
  );
};
